package bd.edu.seu.messmanagmentsystem.model;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.ManyToOne;import java.time.LocalDate;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class Bazar {    @Id    private long bazar_id;    @ManyToOne    private Member member;    private String details;    private double cost;    private LocalDate date;}